import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Helmet } from "react-helmet";
import Home from "./Components/Home";
import Career from "./Components/Career";
import Contact from "./Components/Contact";
import About from "./Components/About";
import Products from "./Components/Products";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Home />
              </>
            }
          />
          <Route
            path="/products"
            element={
              <>
                <Products />
              </>
            }
          />
          <Route
            path="/about"
            element={
              <>
                <About />
              </>
            }
          />
          <Route
            path="/contact"
            element={
              <>
                <Contact />
              </>
            }
          />
          <Route
            path="/career"
            element={
              <>
                <Career />
              </>
            }
          />
        </Routes>
      </BrowserRouter>

      <Helmet>
        <script
          src="https://risingtheme.com/html/demo-becute/becute/assets/js/vendor/popper.js"
          defer="defer"
        ></script>
        <script
          src="https://risingtheme.com/html/demo-becute/becute/assets/js/vendor/bootstrap.min.js"
          defer="defer"
        ></script>
        <script src="https://risingtheme.com/html/demo-becute/becute/assets/js/plugins/swiper-bundle.min.js"></script>
        <script src="https://risingtheme.com/html/demo-becute/becute/assets/js/plugins/glightbox.min.js"></script>
        <script src="https://risingtheme.com/html/demo-becute/becute/assets/js/script.js"></script>
      </Helmet>
    </>
  );
}

export default App;
